import React from 'react';

export default class Log extends React.Component {
  state = {
    ps: ' ',
    em: ' ',
  };

  Ren = (eve) => {
    eve.preventDefault();
    this.props.Ren(this.state.ps, this.state.pz);
  };
  changeEmile = (ev) => {
    this.setState({ ps: ev.target.value });
  };
  changePassword = (ev) => {
    this.setState({ pm: ev.target.value });
  };

  render() {
    return (
      <form onSubmit={this.Ren}>
        <input type='email' placeholder='Email' onChange={this.changeEmile} />
        <input
          type='password'
          placeholder='Password'
          minLength='6'
          onChange={this.changePassword}
        />
        <button>
          <b> Login in</b>
        </button>
      </form>
    );
  }
}
